import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import './App.css';
import { Container, Row, Col } from 'react-bootstrap';
import Header from './components/header/header.jsx';
import Main_wrapper from './components/main-wrapper/Mainwrap';
import Comentcontainer from './components/comment/comentcontainer';
import { Route, BrowserRouter } from 'react-router-dom';
import Users from './components/users/Users';
const App = () => {
  return (
    <>
      <BrowserRouter>
        <Header />
          <Route path={"/main-wrapper"} render={ () => <Main_wrapper/>} />
          <Route path={"/coment"} render={ () => <Comentcontainer/>} />
          <Route path={"/users"} render={ () => <Users/>} />
      </BrowserRouter>
    </>
  );
}


export default App;
